jQuery.fn.isOnScreen = function(){
	var element = this.get(0);
	if(typeof(element) != "undefined" && element !== null)
	{
		var bounds = element.getBoundingClientRect();
		return bounds.top < window.innerHeight && bounds.bottom > 0;
	}
	else
		return false;
};
